import React from 'react';
import NomiHeader from './components/NomiHeader';
import HealthModule from './components/HealthModule';
import WellnessSummary from './components/WellnessSummary';

// Mock data for the charts
const heartRateData = [
  { time: '6 AM', value: 65 },
  { time: '8 AM', value: 70 },
  { time: '12 PM', value: 75 },
  { time: '2 PM', value: 80 },
  { time: '6 PM', value: 85 },
];

const oxygenData = [
  { time: '6 AM', value: 95 },
  { time: '8 AM', value: 97 },
  { time: '12 PM', value: 100 },
  { time: '2 PM', value: 98 },
  { time: '6 PM', value: 97 },
];

const temperatureData = [
  { time: '6 AM', value: 98.0 },
  { time: '8 AM', value: 98.2 },
  { time: '12 PM', value: 98.4 },
  { time: '2 PM', value: 98.6 },
  { time: '6 PM', value: 98.8 },
];

function App() {
  return (
    <div className="min-h-screen">
      {/* Header with Nomi Insight Banner */}
      <NomiHeader />

      {/* Health Modules */}
      <main className="pb-12">
        {/* Heart Rate Module */}
        <HealthModule
          title="Heart Rate"
          icon="â¤ï¸"
          data={heartRateData}
          currentValue="76"
          unit="BPM"
          color="#ef4444"
          insights={[
            "Edna's heart rate averaged 76 BPM today, steady throughout her morning walk.",
            "Her pulse shows a healthy rhythm with mild elevation after lunch â€” a sign of active movement.",
            "Nomi predicts her heart is functioning well within her personalized baseline."
          ]}
          delay={200}
        />

        {/* Oxygen Module */}
        <HealthModule
          title="Oxygen Saturation"
          icon="ðŸŒ¬ï¸"
          data={oxygenData}
          currentValue="98"
          unit="%"
          color="#3b82f6"
          insights={[
            "Edna's oxygen levels stayed around 98%, consistent with her usual range.",
            "Slight dips during sleep hours are normal and align with her breathing pattern.",
            "Nomi recognizes strong respiratory stability today."
          ]}
          delay={400}
        />

        {/* Temperature Module */}
        <HealthModule
          title="Body Temperature"
          icon="ðŸŒ¡ï¸"
          data={temperatureData}
          currentValue="98.4"
          unit="Â°F"
          color="#10b981"
          insights={[
            "Body temperature remained steady at 98.4Â°F.",
            "This stable trend shows her environment is well-balanced.",
            "Nomi detects no signs of fever or environmental stress."
          ]}
          delay={600}
        />

        {/* Wellness Summary */}
        <WellnessSummary delay={800} />
      </main>
    </div>
  );
}

export default App;
